import React, { useState } from "react";

import {
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBInput,
  MDBIcon,
} from "mdb-react-ui-kit";

function App() {
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const onSubmit = (e) => {
    e.preventDefault();
    if (
      username.length > 4 &&
      email.substring(email.length - 10) === "@gmail.com" &&
      password.length > 7
    ) {
      window.location.stat= {username};
      window.location.href = "/city";
    } else {
      alert("enter details properly");
    }
  };

  return (
    <>
      <form onSubmit={onSubmit}>
        <MDBContainer fluid>
          <MDBCard className="text-black m-5" style={{ borderRadius: "25px" }}>
            <MDBCardBody>
              <MDBRow>
                <MDBCol
                  md="10"
                  lg="6"
                  className="order-2 order-lg-1 d-flex flex-column align-items-center"
                >
                  <p className="text-center h1 fw-bold mb-5 mx-1 mx-md-4 mt-4">
                    Registration details
                  </p>
                  <div className="d-flex flex-row align-items-center mb-4 ">
                    <MDBIcon fas icon="user me-3" size="lg" />
                    <MDBInput
                      label="User Name*"
                      id="fname"
                      type="text"
                      className="fname"
                      onChange={(e) => setUsername(e.target.value)}
                    />
                  </div>
                  <p>UserName must be minimum of 5 characters</p>
                  <div className="d-flex flex-row align-items-center mb-4">
                    <MDBIcon fas icon="envelope me-3" size="lg" />
                    <MDBInput
                      label="Email*"
                      type="email"
                      id="email"
                      className="email"
                      onChange={(e) => setEmail(e.target.value)}
                    />
                  </div>
                  <div className="d-flex flex-row align-items-center mb-4">
                    <MDBIcon fas icon="envelope me-3" size="lg" />
                    <MDBInput
                      label="Password*"
                      type="password"
                      id="password"
                      className="password"
                      onChange={(e) => setPassword(e.target.value)}
                    />
                  </div>
                  <p>Password must be minimum of 8 characters</p>
                  <MDBBtn className="mb-4" size="lg">
                    Register
                  </MDBBtn>
                </MDBCol>

                <MDBCol
                  md="10"
                  lg="6"
                  className="order-1 order-lg-2 d-flex align-items-center"
                >
                  <MDBCardImage src="C:\Users\91901\ticket\public\book ticket-1.jpg" />
                </MDBCol>
              </MDBRow>
            </MDBCardBody>
          </MDBCard>
        </MDBContainer>
      </form>
    </>
  );
}

export default App;
